📣 Exciting Announcement! 📣

Hey there, InkBullyTalk fam! 🖤✨ This Friday, we have an incredible treat for you! We're thrilled to welcome the amazing @tfshea as our special guest on InkBullyTalk! 😍🎉

Join us as @tfshea opens up about his life-transforming journey, where he surrendered his life to Christ and the impact it had on his tattoo career. 🙌💉 Not only that, he'll dive into fascinating topics like aliens, as well as his personal struggles with anxiety. It's an episode you definitely don't want to miss! 🌟

Mark your calendars because this mind-blowing episode releases on Friday, June 16th at 8 AM sharp! ⏰ Set your alarms and get ready for an inspiring conversation that will leave you in awe. 🤩

Don't forget to tune in and join the InkBullyTalk community as we delve into @tfshea's incredible story together. 🎙️💪 Stay tuned, spread the word, and get ready for an unforgettable episode! See you all on Friday! 🎧✨

